import 'package:objectbox/objectbox.dart';@Entity(uid: 1)@Sync()class LessonData {  @Id(assignable: true)  int? id;  String? lesson;  LessonData({required this.id, required this.lesson});  LessonData.fromJson(Map<String, dynamic> json) {    id = json['id'] as int?;    lesson = json['lesson']["name"].toString();  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = Map<String, dynamic>();    data['id'] = id;    data['lesson'] = lesson;    return data;  }}class Lesson {  int? id;  String? name;  String? shortname;  Lesson({this.id, this.name, this.shortname});  Lesson.fromJson(Map<String, dynamic> json) {    id = json['id'];    name = json['name'];    shortname = json['short_name'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = Map<String, dynamic>();    data['id'] = id;    data['name'] = name;    data['short_name'] = shortname;    return data;  }}class Name {  String? uz;  String? ru;  String? kiril;  Name({this.uz, this.ru, this.kiril});  Name.fromJson(Map<String, dynamic> json) {    uz = json['uz'];    ru = json['ru'];    kiril = json['kiril'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = Map<String, dynamic>();    data['uz'] = uz;    data['ru'] = ru;    data['kiril'] = kiril;    return data;  }}